import { useEffect, useState } from "react";
import { useAppDispatch, useAppSelector } from "../../app/hooks";
import { logout } from "../../services/Auth/AuthSlice";
import './styles.css';
import CarCard from "./CarCard";
import { selectCarList } from "../../services/Car/CarSelectors";

const Dashboard = () => {
  const [activeTime, setActiveTime] = useState('all');
  const [searchInput, setSearchInput] = useState('');
  const [isSearchModalOpen, setIsSearchModalOpen] = useState(false);
  const [showResults, setShowResults] = useState(false);
  const [activeTab, setActiveTab] = useState('all-cars');
  const [isFilterPageOpen, setIsFilterPageOpen] = useState(false);
  const [showLoginPage, setShowLoginPage] = useState(false);

  const { user, isLoading, error } = useAppSelector((state) => state.auth);
  const cars = useAppSelector(selectCarList);
  const dispatch = useAppDispatch();

  const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setSearchInput(e.target.value);
  };

  const handleSearchSubmit = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };
  const handleSearchClick = (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleApplyFilters = (filters: any) => {
    setShowResults(true);
  };

  const handleLogout = () => {
    dispatch(logout());
  };

  const handleLoginButtonClick = () => {
    setShowLoginPage(true);
  };

  useEffect(() => {
    if (user) {
      setShowLoginPage(false);
    }
  }, [user]);

  const vehicleCategories = [
    { name: 'SUVs', icon: 'ðŸš™' },
    { name: 'Compact cars', icon: 'ðŸš—' },
    { name: 'Luxury cars', icon: 'ðŸŽï¸' },
    { name: 'Economy', icon: 'ðŸ’°' },
  ];

  const previousBookings = [
    {
      id: 1,
      carName: "Toyota Corolla",
      pickupLocation: "Manhattan",
      dropoffLocation: "Brooklyn",
      pickupDate: "2023-12-01",
      dropoffDate: "2023-12-05",
      status: "completed",
      price: "$200",
      image: "/api/placeholder/250/150"
    },
    {
      id: 2,
      carName: "BMW X5",
      pickupLocation: "JFK Airport",
      dropoffLocation: "Downtown",
      pickupDate: "2023-12-10",
      dropoffDate: "2023-12-12",
      status: "upcoming",
      price: "$350",
      image: "/api/placeholder/250/150"
    }
  ];

  const reviews = [
    {
      id: 1,
      userName: "Alice Johnson",
      avatar: "/api/avatar1",
      date: "2024-01-10",
      rating: 5,
      comment: "Great experience! Super smooth process."
    },
    {
      id: 2,
      userName: "Mark Evans",
      avatar: "/api/avatar2",
      date: "2024-02-22",
      rating: 4,
      comment: "The car was clean and efficient. Would rent again!"
    }
  ];

  const formatDate = (dateString: string) =>
    new Date(dateString).toLocaleDateString(undefined, {
      year: "numeric",
      month: "short",
      day: "numeric"
    });

  const renderStars = (count: number) =>
    "â˜…".repeat(count) + "â˜†".repeat(5 - count);

  const renderResultsPage = () => (
    <div className="results-container">
      {/* Tabs */}
      <div className="tabs-container">
        <button
          className={`tab ${activeTab === 'your-bookings' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('your-bookings')}
        >
          Your Bookings
        </button>
        <button
          className={`tab ${activeTab === 'all-cars' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('all-cars')}
        >
          All Cars
        </button>
      </div>

      {/* Car Listings */}
      {activeTab === 'all-cars' && (
        <div className="car-listings">
          {cars.map((car) => (
            <CarCard key={car.Car_Id} {...car} />
          ))}
        </div>
      )}

      {/* Booking History Section */}
      {activeTab === 'your-bookings' && (
        <section className="booking-section">
          <h2>Your Booking History</h2>
          <div className="booking-history-container">
            {previousBookings.map(booking => (
              <div key={booking.id} className="booking-card">
                <div className="booking-image">
                  <img src={booking.image} alt={booking.carName} />
                </div>
                <div className="booking-details">
                  <h3>{booking.carName}</h3>
                  <div className="booking-info">
                    <div className="booking-locations">
                      <p><strong>Pickup:</strong> {booking.pickupLocation}</p>
                      <p><strong>Drop-off:</strong> {booking.dropoffLocation}</p>
                    </div>
                    <div className="booking-dates">
                      <p><strong>From:</strong> {formatDate(booking.pickupDate)}</p>
                      <p><strong>To:</strong> {formatDate(booking.dropoffDate)}</p>
                    </div>
                  </div>
                  <div className="booking-footer">
                    <span className={`booking-status ${booking.status}`}>{booking.status}</span>
                    <span className="booking-price">{booking.price}</span>
                  </div>
                </div>
              </div>
            ))}
          </div>
          <div className="new-booking-container">
            <button className="new-booking-button" onClick={() => setIsSearchModalOpen(true)}>
              Book a New Car
            </button>
          </div>
        </section>
      )}

      {/* Customer Reviews Section */}
      <section className="reviews-section">
        <h2>Customer Reviews</h2>
        <div className="reviews-container">
          {reviews.map(review => (
            <div key={review.id} className="review-card">
              <div className="review-header">
                <div className="reviewer-info">
                  <img src={review.avatar} alt={review.userName} className="reviewer-avatar" />
                  <div className="reviewer-details">
                    <h4>{review.userName}</h4>
                    <p className="review-date">{review.date}</p>
                  </div>
                </div>
                <div className="review-rating">{renderStars(review.rating)}</div>
              </div>
              <div className="review-content">
                <p>{review.comment}</p>
              </div>
            </div>
          ))}
        </div>
        <div className="write-review-container">
          <button className="write-review-button">Write a Review</button>
        </div>
      </section>
    </div>
  );

  return (
    <div className="app-container">
      {showResults ? renderResultsPage() : (
        <main>
          {/* ... (rest of the home screen code like hero, categories, popular) */}
          {/* Popular Section (already included in your code) */}
          {/* ... */}
        </main>
      )}

      {/* Modals and Footer (same as before) */}
    </div>
  );
};

export default Dashboard;
